Ако дадено приложение не бъде използвано няколко месеца:

• разрешенията ще бъдат премахнати с цел защита на данните ви;
• известията ще бъдат спрени с цел икономия на батерията;
• временните файлове ще бъдат премахнати, за да се освободи място.

За да предоставите отново разрешенията и да позволите известията, отворете приложението.
